import ReactDOM from 'react-dom';
import ('./index.css');

ReactDOM.render( 
    <>
    <h1>Thapa Technical Netflix Pick</h1>
    <p> Here the list of my fav 5 netflix series</p>
    <p>List of  Best Series.</p>
    <ol><li>Dark</li></ol>
    <ol><li>Extra curricular</li></ol>
    </>,
    document.getElementById('root')
    );
